import React, {Component} from 'react';


class Table extends Component {;
    render() {
        //console.log("table组件更新搜索词",this.props.filterText)
        let studyIdFiltered = this.props.studyId;
        if (this.props.filterText !== '') {
            //使用正则表达式匹配
            studyIdFiltered = this.props.studyId.filter((studyId) => {
                return -1 !== studyId.search(this.props.filterText);
            });
        }
        return (
            <table>
                <thead>
                    <th>Patient ID</th>
                    <th>Patient Name</th>
                    <th>Patient Gender</th>
                    <th>Patient Birthdate</th>
                    <th>Patient Age</th>
                    <th>Images Count</th>
                </thead>
                <tbody>
                    {studyIdFiltered.map(patient=> {
                        return (

                        <tr> 
                            <td>{patient.patient_id}</td>
                            <td>{patient.patient_name}</td>
                            <td>{patient.patient_sex}</td>
                            <td>{patient.patient_birthdate == null ? "Anonymized" : patient.patient_birthdate}</td>
                            <td>{patient.patient_age}</td>
                            <td>{patient.images_count}</td>
                        </tr>
                        )
                    })}
                </tbody>
            </table>
        )
    }
}
export default Table;
